import React, { useState, useEffect } from 'react';
import { useParams } from 'react-router-dom';
import { FaThumbsUp, FaThumbsDown, FaInfoCircle, FaChartLine, FaMoneyBillWave, FaExchangeAlt } from 'react-icons/fa';
import Chart from './Chart';
import apiService from '../services/api';
import marketService from '../services/market';
import './AssetDetail.css';

const AssetDetail = () => {
  const { ticker } = useParams();
  const [asset, setAsset] = useState(null);
  const [priceHistory, setPriceHistory] = useState([]);
  const [timeFilter, setTimeFilter] = useState('1y');
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [tab, setTab] = useState('overview');

  useEffect(() => {
    const fetchAssetData = async () => {
      try {
        setLoading(true);
        
        // Fetch asset details
        const assetData = await marketService.getAssetDetails(ticker);
        setAsset(assetData);
        
        // Fetch price history
        const history = await marketService.getAssetPriceHistory(ticker, timeFilter);
        setPriceHistory(history);
        
        setError(null);
      } catch (err) {
        console.error('Error fetching asset data:', err);
        setError('Failed to load asset data. Please try again later.');
      } finally {
        setLoading(false);
      }
    };
    
    fetchAssetData();
  }, [ticker, timeFilter]);

  const formatCurrency = (value) => {
    return new Intl.NumberFormat('en-US', {
      style: 'currency',
      currency: 'USD',
      minimumFractionDigits: 2,
      maximumFractionDigits: 2
    }).format(value);
  };
  
  const formatLargeNumber = (value) => {
    if (value >= 1000000000) {
      return `${(value / 1000000000).toFixed(2)}B`;
    } else if (value >= 1000000) {
      return `${(value / 1000000).toFixed(2)}M`;
    } else if (value >= 1000) {
      return `${(value / 1000).toFixed(2)}K`;
    }
    return value.toString();
  };

  if (loading) {
    return <div className="loading">Loading asset data...</div>;
  }

  if (error) {
    return <div className="error-message">{error}</div>;
  }

  return (
    <div className="asset-detail-container">
      {asset && (
        <>
          <div className="asset-header">
            <div className="asset-icon">
              <img src={asset.icon_url} alt={asset.name} />
            </div>
            <div className="asset-title">
              <h2>{asset.name}</h2>
              <div className="asset-ticker">{asset.ticker}</div>
            </div>
            <div className="asset-price">
              <div className="current-price">{formatCurrency(asset.current_price)}</div>
              <div className={`price-change ${asset.price_change_24h >= 0 ? 'positive' : 'negative'}`}>
                {asset.price_change_24h >= 0 ? '+' : ''}
                {asset.price_change_24h.toFixed(2)}%
              </div>
            </div>
          </div>
          
          <div className="asset-tabs">
            <div 
              className={`asset-tab ${tab === 'overview' ? 'active' : ''}`}
              onClick={() => setTab('overview')}
            >
              <FaInfoCircle /> Overview
            </div>
            <div 
              className={`asset-tab ${tab === 'chart' ? 'active' : ''}`}
              onClick={() => setTab('chart')}
            >
              <FaChartLine /> Chart
            </div>
            <div 
              className={`asset-tab ${tab === 'fundamentals' ? 'active' : ''}`}
              onClick={() => setTab('fundamentals')}
            >
              <FaMoneyBillWave /> Fundamentals
            </div>
            <div 
              className={`asset-tab ${tab === 'trading' ? 'active' : ''}`}
              onClick={() => setTab('trading')}
            >
              <FaExchangeAlt /> Trading
            </div>
          </div>
          
          {tab === 'overview' && (
            <div className="asset-overview">
              <div className="asset-description">
                <h3>About {asset.name}</h3>
                <p>{asset.description}</p>
              </div>
              
              <div className="asset-key-stats">
                <div className="stat-item">
                  <div className="stat-label">Market Cap</div>
                  <div className="stat-value">{formatCurrency(asset.market_cap)}</div>
                </div>
                <div className="stat-item">
                  <div className="stat-label">Volume (24h)</div>
                  <div className="stat-value">{formatCurrency(asset.volume_24h)}</div>
                </div>
                <div className="stat-item">
                  <div className="stat-label">Circulating Supply</div>
                  <div className="stat-value">{formatLargeNumber(asset.circulating_supply)} {asset.ticker}</div>
                </div>
                <div className="stat-item">
                  <div className="stat-label">Max Supply</div>
                  <div className="stat-value">{asset.max_supply ? formatLargeNumber(asset.max_supply) : 'Unlimited'}</div>
                </div>
              </div>
              
              <div className="asset-sentiment">
                <h3>Market Sentiment</h3>
                <div className="sentiment-bars">
                  <div className="sentiment-positive" style={{ width: `${asset.positive_sentiment}%` }}>
                    <FaThumbsUp /> {asset.positive_sentiment}%
                  </div>
                  <div className="sentiment-negative" style={{ width: `${100 - asset.positive_sentiment}%` }}>
                    <FaThumbsDown /> {100 - asset.positive_sentiment}%
                  </div>
                </div>
              </div>
            </div>
          )}
          
          {tab === 'chart' && (
            <div className="asset-chart-section">
              <div className="chart-container detail-chart">
                <Chart 
                  data={priceHistory}
                  selectedAsset={asset}
                  timeFilter={timeFilter}
                  height={400}
                />
              </div>
              
              <div className="chart-time-filters">
                <div 
                  className={`chart-time-filter ${timeFilter === '1d' ? 'active' : ''}`}
                  onClick={() => setTimeFilter('1d')}
                >
                  1D
                </div>
                <div 
                  className={`chart-time-filter ${timeFilter === '1w' ? 'active' : ''}`}
                  onClick={() => setTimeFilter('1w')}
                >
                  1W
                </div>
                <div 
                  className={`chart-time-filter ${timeFilter === '1m' ? 'active' : ''}`}
                  onClick={() => setTimeFilter('1m')}
                >
                  1M
                </div>
                <div 
                  className={`chart-time-filter ${timeFilter === '3m' ? 'active' : ''}`}
                  onClick={() => setTimeFilter('3m')}
                >
                  3M
                </div>
                <div 
                  className={`chart-time-filter ${timeFilter === '1y' ? 'active' : ''}`}
                  onClick={() => setTimeFilter('1y')}
                >
                  1Y
                </div>
                <div 
                  className={`chart-time-filter ${timeFilter === 'all' ? 'active' : ''}`}
                  onClick={() => setTimeFilter('all')}
                >
                  All
                </div>
              </div>
            </div>
          )}
          
          {tab === 'fundamentals' && (
            <div className="asset-fundamentals">
              <div className="fundamentals-section">
                <h3>Key Information</h3>
                <div className="fundamentals-grid">
                  <div className="fundamental-item">
                    <div className="fundamental-label">Launch Date</div>
                    <div className="fundamental-value">{asset.launch_date || 'Unknown'}</div>
                  </div>
                  <div className="fundamental-item">
                    <div className="fundamental-label">Category</div>
                    <div className="fundamental-value">{asset.category}</div>
                  </div>
                  <div className="fundamental-item">
                    <div className="fundamental-label">Technology</div>
                    <div className="fundamental-value">{asset.technology}</div>
                  </div>
                  <div className="fundamental-item">
                    <div className="fundamental-label">Founder</div>
                    <div className="fundamental-value">{asset.founder || 'Unknown'}</div>
                  </div>
                  <div className="fundamental-item">
                    <div className="fundamental-label">Consensus Mechanism</div>
                    <div className="fundamental-value">{asset.consensus_mechanism || 'N/A'}</div>
                  </div>
                  <div className="fundamental-item">
                    <div className="fundamental-label">Website</div>
                    <div className="fundamental-value">
                      <a href={asset.website} target="_blank" rel="noopener noreferrer">{asset.website}</a>
                    </div>
                  </div>
                </div>
              </div>
              
              <div className="fundamentals-section">
                <h3>Market Data</h3>
                <div className="fundamentals-grid">
                  <div className="fundamental-item">
                    <div className="fundamental-label">All-Time High</div>
                    <div className="fundamental-value">{formatCurrency(asset.ath)}</div>
                  </div>
                  <div className="fundamental-item">
                    <div className="fundamental-label">All-Time Low</div>
                    <div className="fundamental-value">{formatCurrency(asset.atl)}</div>
                  </div>
                  <div className="fundamental-item">
                    <div className="fundamental-label">Liquidity Score</div>
                    <div className="fundamental-value">{asset.liquidity_score}/100</div>
                  </div>
                  <div className="fundamental-item">
                    <div className="fundamental-label">Market Cap Rank</div>
                    <div className="fundamental-value">#{asset.market_cap_rank}</div>
                  </div>
                </div>
              </div>
            </div>
          )}
          
          {tab === 'trading' && (
            <div className="asset-trading">
              <div className="trading-section">
                <h3>Trading Information</h3>
                <div className="trading-grid">
                  <div className="trading-item">
                    <div className="trading-label">24h High</div>
                    <div className="trading-value">{formatCurrency(asset.high_24h)}</div>
                  </div>
                  <div className="trading-item">
                    <div className="trading-label">24h Low</div>
                    <div className="trading-value">{formatCurrency(asset.low_24h)}</div>
                  </div>
                  <div className="trading-item">
                    <div className="trading-label">Price Change (7d)</div>
                    <div className={`trading-value ${asset.price_change_7d >= 0 ? 'positive' : 'negative'}`}>
                      {asset.price_change_7d >= 0 ? '+' : ''}
                      {asset.price_change_7d.toFixed(2)}%
                    </div>
                  </div>
                  <div className="trading-item">
                    <div className="trading-label">Price Change (30d)</div>
                    <div className={`trading-value ${asset.price_change_30d >= 0 ? 'positive' : 'negative'}`}>
                      {asset.price_change_30d >= 0 ? '+' : ''}
                      {asset.price_change_30d.toFixed(2)}%
                    </div>
                  </div>
                </div>
              </div>
              
              <div className="trading-section">
                <h3>Top Exchanges</h3>
                <div className="exchanges-list">
                  {asset.exchanges.map((exchange, index) => (
                    <div key={index} className="exchange-item">
                      <div className="exchange-logo">
                        <img src={exchange.logo} alt={exchange.name} />
                      </div>
                      <div className="exchange-name">{exchange.name}</div>
                      <div className="exchange-volume">{formatCurrency(exchange.volume_24h)}</div>
                      <div className="exchange-price">{formatCurrency(exchange.price)}</div>
                    </div>
                  ))}
                </div>
              </div>
            </div>
          )}
        </>
      )}
    </div>
  );
};

export default AssetDetail;
